response.activities:
 Представительство в мировых судах, судах общей юрисдикции, арбитражных судах и  в иных государственных органах; 
 Обжалование действий и бездействий должностных лиц; 
 Комплексное правовое сопровождение физических и юридических лиц; 
 Представление интересов сторон в исполнительном производстве; 
 Защита прав потребителей; 
 Помощь в оформлении гражданского и заграничного паспортов, гражданства РФ, регистрации по месту жительства и месту пребывания; 
 Регистрация иностранных граждан, приглашение иностранных граждан; 
 Оформление гражданства несовершеннолетним; 
  Оформление и сопровождение сделок с недвижимостью; 
 Помощь в разрешении земельных споров, межевание земельных участков, постановка на кадастровый учет, оформление самовольных строений; 
 Купля- продажа земельных участков, жилых и коммерческих строений; 
 Аренда, обмен, дарение;
 Регистрация и ликвидация предприятий и многое другое.
